// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.7;

contract test {

    event Transfer(address to, address from, uint256 amount);

    uint private constant NUMBER = 2;
    bool private locked = false;

    modifier nonReentrant() {
        locked = true;
        _;
        locked = false;
    }

    function testing (uint aux, uint aux2, uint8 num) external view returns (uint) {
        require(!locked,"Reentrancy not allowed");
        if(num == 1)
            return aux + aux2 + 1;
        else
            return aux + aux2 + 2;
    }

}

